import React, { useState, useEffect } from 'react';
import { Truck, AlertTriangle, CheckCircle, MapPin, RotateCw, Package } from 'lucide-react';
import { Alert, AlertDescription } from '@/components/ui/alert';

const Reports = () => {
  const [trucks, setTrucks] = useState([]);
  const [reportData, setReportData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [isFetching, setIsFetching] = useState(false);
  const [lastUpdated, setLastUpdated] = useState(null);

  // ... [keeping all the fetch functions the same] ...

  const getStatusColor = (status) => {
    switch (status?.toLowerCase()) {
      case 'active':
        return 'text-green-400';
      case 'inactive':
        return 'text-gray-400';
      case 'maintenance':
        return 'text-yellow-400';
      case 'error':
        return 'text-red-400';
      default:
        return 'text-gray-400';
    }
  };

  const getCapacityColor = (capacity) => {
    if (capacity === null || capacity === undefined) return 'bg-gray-700';
    if (capacity > 90) return 'bg-red-500';
    if (capacity > 70) return 'bg-yellow-500';
    return 'bg-green-500';
  };

  if (loading) {
    return (
      <div className="flex flex-col items-center justify-center h-96 bg-gray-900 rounded-lg">
        <div className="animate-spin rounded-full h-12 w-12 border-4 border-gray-600 border-t-blue-500"></div>
        <p className="mt-4 text-gray-400">Loading fleet status...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="p-6">
        <Alert variant="destructive">
          <AlertTriangle className="h-4 w-4" />
          <AlertDescription>{error}</AlertDescription>
        </Alert>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header Section */}
      <div className="bg-gray-900 rounded-lg shadow-xl">
        <div className="p-6 flex justify-between items-center">
          <div>
            <h2 className="text-2xl font-bold text-white flex items-center gap-2">
              <Truck className="h-6 w-6" />
              Fleet Status Dashboard
            </h2>
            <p className="text-gray-400 mt-1">
              {reportData.length} vehicles in operation
            </p>
          </div>
          <button
            onClick={fetchTrucks}
            disabled={isFetching}
            className="flex items-center gap-2 px-4 py-2 bg-gray-800 rounded-lg hover:bg-gray-700 transition-colors disabled:opacity-50"
          >
            <RotateCw className={`h-4 w-4 ${isFetching ? 'animate-spin' : ''}`} />
            Refresh
          </button>
        </div>

        {/* Dashboard Stats */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4 p-6 border-t border-gray-800">
          {reportData.length > 0 && (
            <>
              <div className="bg-gray-800 rounded-lg p-4">
                <div className="flex items-center gap-2 text-gray-400 mb-2">
                  <CheckCircle className="h-4 w-4" />
                  <span>Active Trucks</span>
                </div>
                <p className="text-2xl font-bold text-white">
                  {reportData.filter(t => t.currentStatus?.toLowerCase() === 'active').length}
                </p>
              </div>
              <div className="bg-gray-800 rounded-lg p-4">
                <div className="flex items-center gap-2 text-gray-400 mb-2">
                  <Package className="h-4 w-4" />
                  <span>Average Capacity</span>
                </div>
                <p className="text-2xl font-bold text-white">
                  {Math.round(reportData.reduce((acc, curr) => acc + (curr.capacityUtilization || 0), 0) / reportData.length)}%
                </p>
              </div>
              <div className="bg-gray-800 rounded-lg p-4">
                <div className="flex items-center gap-2 text-gray-400 mb-2">
                  <MapPin className="h-4 w-4" />
                  <span>On Route</span>
                </div>
                <p className="text-2xl font-bold text-white">
                  {reportData.filter(t => t.onRoute).length}
                </p>
              </div>
            </>
          )}
        </div>
      </div>

      {/* Fleet Table */}
      <div className="bg-gray-900 rounded-lg shadow-xl overflow-hidden">
        <div className="overflow-x-auto">
          {reportData.length > 0 ? (
            <table className="w-full">
              <thead>
                <tr className="text-left border-b border-gray-800">
                  <th className="px-6 py-4 text-gray-400 font-medium">Truck Info</th>
                  <th className="px-6 py-4 text-gray-400 font-medium">Status</th>
                  <th className="px-6 py-4 text-gray-400 font-medium">Capacity</th>
                  <th className="px-6 py-4 text-gray-400 font-medium">Location</th>
                  <th className="px-6 py-4 text-gray-400 font-medium">Destination</th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-800">
                {reportData.map((report) => (
                  <tr key={report.truckId} className="hover:bg-gray-800/50 transition-colors">
                    <td className="px-6 py-4">
                      <div className="flex items-center gap-3">
                        <div className="bg-gray-800 p-2 rounded-lg">
                          <Truck className="h-5 w-5 text-gray-400" />
                        </div>
                        <div>
                          <p className="font-medium text-white">{report.name}</p>
                          <p className="text-sm text-gray-400">ID: {report.truckId}</p>
                        </div>
                      </div>
                    </td>
                    <td className="px-6 py-4">
                      <span className={`inline-flex items-center gap-1.5 ${getStatusColor(report.currentStatus)}`}>
                        <span className={`w-2 h-2 rounded-full ${getStatusColor(report.currentStatus)} animate-pulse`}></span>
                        {report.currentStatus}
                      </span>
                    </td>
                    <td className="px-6 py-4">
                      <div className="flex items-center gap-2">
                        <div className="flex-grow bg-gray-700 rounded-full h-2 w-24">
                          <div
                            className={`${getCapacityColor(report.capacityUtilization)} h-2 rounded-full transition-all duration-500`}
                            style={{ width: `${report.capacityUtilization || 0}%` }}
                          ></div>
                        </div>
                        <span className="text-gray-400 text-sm">
                          {report.capacityUtilization || 0}%
                        </span>
                      </div>
                    </td>
                    <td className="px-6 py-4">
                      <div className="flex items-center gap-2">
                        <MapPin className="h-4 w-4 text-gray-400" />
                        <span className="text-white">{report.currentLocation}</span>
                      </div>
                    </td>
                    <td className="px-6 py-4">
                      <span className="text-gray-400">{report.currentDestination}</span>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <div className="flex flex-col items-center justify-center p-12">
              <Truck className="h-12 w-12 text-gray-600 mb-4" />
              <p className="text-gray-400 text-lg">No truck data available</p>
              <button
                onClick={fetchTrucks}
                className="mt-4 px-4 py-2 bg-gray-800 rounded-lg hover:bg-gray-700 transition-colors"
              >
                Refresh Data
              </button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Reports;
